        <div className={styles.left_div}>
          <NavLink to="/home">Logo</NavLink>
        </div>
        <div className={styles.left_div}>
          {" "}
          <NavLink to="/home">Login</NavLink>
        </div>
      </div>
      <nav>
        <ul>
          <li>My Orders</li>
          <li>My Profile</li>
          <li>Store</li>
          <li>Cart</li>
        </ul>
      </nav>
    </header>
  );
};

export default Navigation;
